// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useParams, useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

// Main App Component
function App() {
  return (
    <Router>
      <div className="container mt-4">
        <Routes>
          <Route path="/node/:id" element={<NodePage />} />
          <Route path="/" element={<NavigateToRoot />} />
        </Routes>
      </div>
    </Router>
  );
}

// Redirect to root node (ID 1)
function NavigateToRoot() {
  const navigate = useNavigate();
  React.useEffect(() => navigate('/node/1'), [navigate]);
  return null;
}

// Node Page Component
function NodePage() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [node, setNode] = React.useState(null);
  const [children, setChildren] = React.useState([]);
  const [path, setPath] = React.useState([]);

  // Fetch node data
  React.useEffect(() => {
    const fetchData = async () => {
      const [nodeRes, childrenRes, pathRes] = await Promise.all([
        fetch(`http://localhost:5000/api/nodes/${id}`),
        fetch(`http://localhost:5000/api/nodes/${id}/children`),
        fetch(`http://localhost:5000/api/nodes/${id}/path`)
      ]);

      setNode(await nodeRes.json());
      setChildren(await childrenRes.json());
      setPath((await pathRes.json()).reverse());
    };

    fetchData();
  }, [id]);

  // Create new child node
  const createNode = async () => {
    await fetch('http://localhost:5000/api/nodes', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ parent_id: parseInt(id), score: 1.0 })
    });

    // Refresh data
    const childrenRes = await fetch(`http://localhost:5000/api/nodes/${id}/children`);
    setChildren(await childrenRes.json());
  };

  if (!node) return <div>Loading...</div>;

  return (
    <div>
      {/* Breadcrumb Navigation */}
      <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
          {path.map(n => (
            <li key={n.id} className="breadcrumb-item">
              <Link to={`/node/${n.id}`}>Node {n.id}</Link>
            </li>
          ))}
          <li className="breadcrumb-item active" aria-current="page">
            Node {node.id}
          </li>
        </ol>
      </nav>

      {/* Node Details */}
      <h1>Node {node.id}</h1>
      <p className="lead">Popularity: {node.popularity.toFixed(2)}</p>

      {/* Children List */}
      <div className="card mt-4">
        <div className="card-header">
          <h2>Children Nodes</h2>
        </div>
        <ul className="list-group list-group-flush">
          {children.map(child => (
            <li key={child.id} className="list-group-item">
              <Link to={`/node/${child.id}`} className="btn btn-link">
                Node {child.id} (Score: {child.popularity.toFixed(2)})
              </Link>
            </li>
          ))}
        </ul>
      </div>

      {/* Action Buttons */}
      <div className="mt-4">
        <button className="btn btn-primary me-2" onClick={createNode}>
          Create Child Node
        </button>
        {node.parent_id && (
          <button className="btn btn-secondary" onClick={() => navigate(`/node/${node.parent_id}`)}>
            Back to Parent
          </button>
        )}
      </div>
    </div>
  );
}

export default App;
